import React from 'react';
import { withRouter } from 'react-router-dom';
const Logout = (props) => {

    window.localStorage.removeItem("vmisJwt");
    console.log("removed")
    props.history.push("/login")
    return (<h1>Logging Out</h1>)
}
export default withRouter(Logout)
